import React from 'react';
import './EdgeList.css';

const EdgeList = ({ edges }) => (
  <div className="edge-list">
    <h3>Список Ребер</h3>
    <ul>
      {edges.map((edge, idx) => (
        <li key={idx}>
          {edge.from} → {edge.to}
        </li>
      ))}
    </ul>
  </div>
);

export default EdgeList;
